import image from "../image"
import {useState} from 'react'

function SingIn() {


    const css = {
        body : {
            width: '400px',
            height: '550px',
            backgroundColor: '#0d1a2c',
            margin: 'auto',
            marginTop: '50px',
            marginBottom: '100px',
            paddingLeft: '50px',
            paddingRight: '50px',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            color: 'white'
        },
        h1 : {
            width: '400px',
            marginTop: '50px',
        }

    }

    return (
        <div style={css.body}>
            <h1 style={css.h1}>Sign In</h1>




        </div>
    )
}
export default SingIn
